        var sprites = {};

        Easycanvas.imgLoader.cacheCanvas = Math.random() < 0.5;
        Easycanvas.imgLoader(constants.jpg100px, function (img) {
            // 跳过绘制0个
            sprites.type1 = [];
            for (var i = 0; i < 2; i++) {
                let sprite = $Painter.add({
                    name: 'type1',
                    content: {
                        img: img,
                    },
                    style: {
                        tx: Math.random() * 200, ty: Math.random() * 200,

                    },
                });
                sprites.type1.push(sprite);
            }
        });

        Easycanvas.imgLoader.cacheCanvas = Math.random() < 0.5;
        Easycanvas.imgLoader(constants.png30px, function (img) {
            // 跳过绘制4个
            sprites.type2 = [];

                let sprite = $Painter.add({
                    name: 'type2',
                    content: {
                        img: img,
                    },
                    style: {
                        tx: 100, ty: 100,
                        tw: 200, th: 200,
                        zIndex: 2,
                    },
                });
                sprites.type2.push(sprite);
            }
        });

        Easycanvas.imgLoader.cacheCanvas = true;
        Easycanvas.imgLoader(constants.jpg100px, function (img) {
